def read_emails_from_csv(file_name='emails.csv'):
    """
    Read email addresses from a CSV file.

    Args:
        file_name (str): Name of the CSV file containing email addresses. Default is 'emails.csv'.

    Returns:
        list: List of email addresses read from the CSV file.
    """
    email_list = []
    file_path = os.path.join(os.path.dirname(__file__), file_name)
    with open(file_path, 'r') as file:
        for line in file:
            email_list.append(line.strip())  # Remove leading/trailing whitespaces
    return email_list

